import Landing from "./components/landing/Landing";
import Present from "./components/present/Present";
import Redirect from "./components/redirect/Redirect";

function App() {
  return (
    <div className="App">
      <Landing />
      <Present />
      <Redirect />
    </div>
  );
}

export default App;
